  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Aleutian Islands
  National Wildlife Refuge outlines Refuge accomplishments from January to June 1952.
  The report begins by summarizing the weather conditions and water conditions during
  this period. Wildlife- including migratory birds, upland game birds, big game animals,
  and fish- is also covered. A progress report on field investigations and applied
  research is also provided. The public relations section of the report describes
  Refuge participation.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
